import React from "react";
import './footer.css';
import logoTt from './twitter.png'
import logoFace from './face.png' 
import logoInsta from './instag.png' 


function Footer(){
    return(
     <div className="footer">

        <div id="logos">
            <img id="editar" src={logoTt} />
            <img id="editar" src={logoFace} />
            <img id="editar" src={logoInsta} />
        </div>

        <div className="assinatura">
            <h1 id="assinatura">CALOS HENRIQUE PIZZI</h1>
        </div>

     </div>
    )
}

export default Footer;
